import React, { Component } from "react";
import { Link } from "react-router-dom";

import Header from "./common/Header";
import Footer from "./common/Footer";

import ScriptTag from 'react-script-tag';
import AOS from 'aos'; 

let ref_url = localStorage["refState"] ? JSON.parse(localStorage["refState"]).refURL : "";

// console.log(ref_url);

export default class Home extends Component {
  constructor(props) {
    super(props);
    AOS.init(); 
  }

  componentWillReceiveProps (){ 
    AOS.refresh(); 
  } 

  render() {
    return (
        <body className="page-overview  ac-gn-current-music">
          <Header/>
		<section id="section-battery" className="section section-battery theme-dark" data-anim-scroll-group="section-battery" data-analytics-fallback-section-engagement="name:battery">
			<div className="copy-scroll-container" data-component-list="CopyMagic">
				<div className="sticky-copy-lockup flex-copy-lockup intro">
					<div className="copy-block align-text intro-headline" data-copy="0">
						<p className="typography-section-eyebrow">Types of Membership</p>
						<h3 className="typography-section-headline"><div data-aos="slide-left" data-aos-offset="300" data-aos-easing="ease-in-sine" data-aos-duration="500">Ordinary Member</div></h3>
						<p className="typography-section-eyebrow" data-aos="fade-in" data-aos-offset="300" data-aos-easing="ease-in-sine" data-aos-duration="1000">Sapioclub ordinary members are siblings with annual membership subscription with the club and are entitled to several benefits of the club amongst which are entertainment, events, shopping, health, business, hotels and a lots more.</p>
					</div>
				</div>
			</div>
        </section>
		<section id="section-quality" className="section section-quality" data-anim-scroll-group="section-quality" data-analytics-fallback-section-engagement="name:audio-quality">
			<div className="copy-scroll-container" data-component-list="CopyMagic">
				<div className="sticky-copy-lockup flex-copy-lockup intro">
					<div className="copy-block align-text" data-copy="0" data-copy-small="0" data-copy-fade-at-small="75" data-time-offset="75">
						<h3 className="typography-section-headline" data-aos="slide-left" data-aos-offset="100" data-aos-easing="ease-in-sine" data-aos-duration="500">Platinum Member</h3>
						<p className="typography-section-eyebrow"  data-aos="fade-in" data-aos-offset="100" data-aos-easing="ease-in-sine" data-aos-duration="1000">Sapioclub platinum members are exceptional people who have either be selected after review from the stakeholders or rather must have been invited/reffered by three(3) existing platinum members for review consideration before being selected.</p>
					</div>
				</div>
			</div>
		</section>

		<section id="section-ar" className="section section-ar theme-dark" data-anim-scroll-group="section-ar" data-analytics-fallback-section-engagement="name:ar" data-analytics-section-custom="ar" data-analytics-section-engagement="name:ar">
			<div className="section-content">
				<div className="banner-copy">
					<div className="icon-ar"></div>
					<h3 className="typography-router-headline" data-aos="slide-left" data-aos-offset="100" data-aos-easing="ease-in-sine" data-aos-duration="500">Become a<br />Member!</h3>
					<p className="typography-router-tagline ar-copy hide-on-quicklook" data-aos="fade-in" data-aos-offset="200" data-aos-easing="ease-in-sine" data-aos-duration="1000">Join the community of Intellectuals.</p>
					<Link to="/register" className="ac-ln-button ar-copy hide-on-quicklook" data-aos="fade-in" data-aos-offset="200" data-aos-easing="ease-in-sine" data-aos-duration="1000">Join Now</Link>
				</div>
				<figure className="image-ar" data-aos="slide-up" data-aos-offset="100" data-aos-easing="ease-in-sine" data-aos-duration="500"></figure>
			</div>
		</section>
	{/*/main*/}
	<Footer/>
        {/* Template Main JS File */}
        <ScriptTag type="text/javascript" src="https://www.apple.com/ac/localnav/5/scripts/ac-localnav.built.js" />
      </body>
    );
  }
}
